import React from 'react'

export default function DroneTelemetry() {

  const telemetry = {
    'Speed': '12 mph',
    'Altitude': '400 ft',
    'Distance': '0.68 mi',
    'waypoint': '2'



  }


  return (
    <div className='grid'>
      <div className='w-full text-center font-bold text-white bg-space-between-border rounded-md'>
        Flight Telemetry and Status

      </div>
      <div className='rounded-md w-full h-auto text-white'>

        <span className='rounded-md p-2 bg-banner-color my-2'>
          speed: {telemetry.Speed}
        </span>

        <span className=' rounded-md p-2 bg-banner-color my-2'>
          Altitude: {telemetry.Altitude}
        </span>

        <span className='rounded-md p-2 bg-banner-color my-2 w-full'>
          Traveling to waypoint: {telemetry.waypoint}
        </span>

        <span className='rounded-md p-2 bg-banner-color my-2'>
          Distance to Destination: {telemetry.Distance}
        </span>
      </div>



    </div>
  )
}
